                                0,
                                1
                            ),
                            0,
                            0,
                            5
                        )

                        MainValue:TweenSize(pos1, "Out", "Sine", 0.2, true)

                        ConneValue:TweenPosition(pos, "Out", "Sine", 0.2, true)
                        if floor == true then
                            local value = string.format("%.1f", ((pos.X.Scale * max) / max) * (max - min) + min)
                            CustomValue.Text = tostring(value)
