local function Time()
    Minutes = os.date("*t")["min"]
    Hours = os.date("*t")["hour"]
    Time = "AM"
    
    if Hours > 12 then
        Hours = Hours - 12
        Time = "PM"
    end
    
    Hours = tostring(Hours)
    Minutes = tostring(Minutes)
    
    if string.len(Minutes) == 1 then
        Minutes = "0"..Minutes..""
    end

    return Hours..":"..Minutes.." "..Time
end    

