function Align(Part0, Part1, Position, Orientation)
    local AliPos = Instance.new("AlignPosition", Part0)
    local AliOri = Instance.new("AlignOrientation", Part0)
    local Attachment1 = Instance.new("Attachment", Part0)
    local Attachment2 = Instance.new("Attachment", Part1)
    AliPos.Attachment0, AliPos.Attachment1 = Attachment1, Attachment2
    AliOri.Attachment0, AliOri.Attachment1 = Attachment1, Attachment2
    AliPos.MaxForce, AliOri.MaxTorque = 9e37, math.huge
    AliPos.Responsiveness, AliOri.Responsiveness = 200, 200
    Attachment1.Position = Position or Vector3.new(0, 0, 0) 
    Attachment1.Orientation = Orientation or Vector3.new(0, 0, 0)
end

function R15(Part0,Part1,Position,Orientation)
		for _,v in pairs(Part0:GetChildren()) do
			if v:IsA("Motor6D") and v.Name ~= "Neck" then
				v:Destroy()
			end
		end
		Align(Part0,Part1,Position,Orientation)
	end

    
    
